import React , { useState } from 'react' ; 
import { Link } from 'react-router-dom';
import Logo from '../../../images/logo.png';
import useStyles from './navbar-jss';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faGripLines,
   /* faSignOutAlt,
    faEnvelope,
    faUser,
    faFileAlt,
    faCheck,*/
} from '@fortawesome/free-solid-svg-icons';




const Navbar = () => {


    const guestMenu = (
        <div>
          
          <li className='nav-item'>
            <Link className='nav-link button-primary my-sm-0' to='/Login'>
              Sign in
            </Link>
          </li>
        </div>
      );
    
      const [toggleStatus, setToggleStatus] = useState('closed');
    
      const classes = useStyles();
    
      const handleToggle = () => {
        toggleStatus === 'closed'
          ? setToggleStatus('opened')
          : setToggleStatus('closed');
      };




    return (
        <nav
          className={`${classes.navbar} navbar navbar-expand-lg navbar-light bg-white`}
        >
          <div className='container'>
            <Link className='navbar-brand' to='/'>
              <img className='logo' src={Logo} alt='esisoc' />
            </Link>
            <button
              className='navbar-toggler'
              type='button'
              data-toggle='collapse'
              data-target='#navbarSupportedContent'
              aria-controls='navbarSupportedContent'
              aria-expanded='false'
              aria-label='Toggle navigation'
              onClick={handleToggle}
            >
              <FontAwesomeIcon
                style={
                  toggleStatus !== 'closed' && {
                    transformOrigin: 'center',
                    transform: 'rotate(90deg)',
                  }
                }
                icon={faGripLines}
              />
            </button>
    
            <div className='collapse navbar-collapse' id='navbarSupportedContent'>
              <ul className='navbar-nav mr-auto'>
                <li className='nav-item'>
                  <Link className='nav-link' to='/requests'>
                    Requests
                  </Link>
                </li>

                <li className='nav-item'>
                  <Link className='nav-link' to='/offers'>
                    Offers
                  </Link>
                </li>
              </ul>
    
              
              <ul className='navbar-nav'>
                { guestMenu }
              </ul>
            </div>
          </div>
        </nav>
      );
    };

  export default Navbar ;
